import styled from "styled-components";

export const Wrap = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 100%;
  background-color: #fff;
  height: 100%;
  padding: 1.5rem 0;
`;

export const UserInfo = styled.div`
  display: flex;
  height: 150px;
`;
